import React, { Component } from 'react';

export default class index extends Component {
  render() {
    return (
      <div style={{ margin: 10 }}>
        Wir bitten um Ihre Teilnahme an der Marktabfrage. Die von Ihnen im
        Rahmen der Marktabfrage zur Verfügung gestellten personenbezogenen Daten
        werden ausschließlich von den aufgelisteten Unternehmen verarbeitet. Mit
        der Verarbeitung der personenbezogenen Daten wird das berechtigte
        Interesse verfolgt, Ihre Projekte bei der Planung des Szenariorahmens
        und des Netzentwicklungsplans (NEP) Gas 2022-2032 zu berücksichtigen
        (Art. 6 Abs. 1 S. 1 lit. f der Datenschutz-Grundverordnung). Auf Basis
        der zur Verfügung gestellten Daten erfolgt die Ermittlung der
        notwendigen Netzausbaumaßnahmen zum Aufbau einer
        Wasserstoffinfrastruktur unter Wahrung der Systemstabilität und
        Versorgungssicherheit des Erdgastransportsystems.
      </div>
    );
  }
}
